import React from "react"

function handleClick(){
    alert("I was clicked")
}

function MyApp() {
    
    return(
        <div>
            <img onMouseOver={handleClick} src="https://www.fillmurray.com/200/100"/>
            <br />
            <br />
            <button onClick={handleClick}>Click me</button>
        </div>
    )

}

export default MyApp
